/*Data for the table `campaigns` */

insert  into `campaigns`(`id_campaign`,`name_campaign`,`desc_campaign`,`active`,`imagen_mini`,`imagen_big`,`id_campaign_type`,`novedad`) values (1,'Gafas de sol - verano 2014','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Etiam vitae turpis augue. Nam in sem quis quam malesuada condimentum. Nullam imperdiet nulla sapien, id consectetur lorem rhoncus eu. Duis eget risus sit amet augue facilisis volutpat. Integer pretium ultricies odio vitae ultricies.',1,'1399909815_5.aprendo_q.jpg','',2,1),(2,'Monturas coleccin 2014','In in sem a ipsum ultricies semper rutrum ut est. Sed nec enim mattis, dictum turpis in, cursus ipsum. Donec fermentum mollis risus, vel congue sem semper eu. Vivamus accumsan auctor rutrum. Morbi a congue diam.',1,'1399989568_5.aprendo_q.jpg','',2,0),(3,'Otras campaas','In semper sapien ac metus euismod, ut mollis elit ultrices. Nulla commodo tellus sit amet interdum rutrum. Pellentesque eget erat metus. Nam eget erat sit amet nisi pulvinar pharetra. Proin id est ultricies, facilisis ipsum id, dignissim purus. ',1,'1399989624_3.ranking.jpg','',3,0),(4,'Nueva campaa','sf sdfsdfsdf sdf',0,'','',2,0),(5,'Campaa nueva','En un lugar de la Mancha, de cuyo nombre no quiero acordarme, no ha mucho tiempo que viva un hidalgo de los de lanza en astillero, adarga antigua, rocn flaco y galgo corredor. Una olla de algo ms vaca que carnero, salpicn las ms noches, duelos y quebrantos los sbados, lantejas los viernes, algn palomino de aadidura los domingos, consuman las tres partes de su hacienda.',0,'1399907395_8.oveja_ovejao.jpg','1399907353_1.home.jpg',2,1),(6,'sdfsdfsdf','dfs',0,'','',3,1),(7,'Reparacin de lentes','Con estas razones perda el pobre caballero el juicio, y desvelbase por entenderlas y desentraarles el sentido, que no se lo sacara ni las entendiera el mesmo Aristteles, si resucitara para slo ello. ',1,'1399989816_8.oveja_ovejao.jpg','',1,0);

