insert  into `campaigns_types`(`id_campaign_type`,`campaign_type_name`,`campaign_type_desc`) values (1,'Servicios','En un lugar de la Mancha, de cuyo nombre no quiero acordarme, no ha mucho tiempo que viva un hidalgo de los de lanza en astillero, adarga antigua, rocn flaco y galgo corredor'),(2,'Productos','Una olla de algo ms vaca que carnero, salpicn las ms noches, duelos y quebrantos los sbados, lantejas los viernes, algn palomino de aadidura los domingos, consuman las tres partes de su hacienda. El resto della concluan sayo de velarte, calzas de velludo para las fiestas, con sus pantuflos de lo mesmo, y los das de entresemana se honraba con su vellor de lo ms fino. '),(3,'Otro tipo','Es, pues, de saber que este sobredicho hidalgo, los ratos que estaba ocioso, que eran los ms del ao, se daba a leer libros de caballeras, con tanta aficin y gusto, que olvid casi de todo punto el ejercicio de la caza, y aun la administracin de su hacienda. ');

