ulla, sodales et pretium quis, iaculis id ex. Quisque pharetra in ex in hendrerit. Nulla bibendum mollis pulvinar. Nullam felis leo, mattis quis lacus a, mattis dictum tortor. Mauris ac feugiat turpis. ','','2014-10-02 15:31:55','admin','comercial',0,'',1,0,0),(45,37,'','Otro curso en el rea de trabajo PRUEBA INICIAL','HTML5 offers some new elements, primarily for semantic purposes. The elements include: section, article, aside, header, footer, nav, figure, figcaption, time, mark, main.','','2014-10-09 16:40:46','admin','comercial',0,'',1,9,0),(46,37,'','Otro foro en el rea inicial','Partial support refers to missing the default styling. This is easily taken care of by using display:block for all new elements (except time and mark, these should be display:inline anyway). IE11 and older versions of other browsers do not support the <main> element.','','2014-10-09 16:45:46','admin','comercial',0,'',1,9,0),(47,37,'','Un foro en el areaa inicial','durante una semana, desde el 16 al 20 de junio tendrs que contestar a 3 preguntas diarias sobre la informacin que subimos en tu \"info\" siempre ms. Una a las 10:00, otra a las 15:00 y otra a las 18:00. El viernes da 20 activaremos todas las preguntas a modo respesca para darte la ltima oportunidad para conseguir una camiseta del 2 aniversario.* *mximo 20 unidades','','2014-10-09 16:59:48','admin','comercial',0,'',1,9,0),(48,37,'','Ms foros para el reas INICIAL','Yes, you can enable accessible colors from this link or from the option under Settings. This color scheme will be used again on revisit. ','','2014-10-09 17:02:53','admin','comercial',0,'',1,9,0),(49,37,'','Ms para el re de trabajo INICIAL','Adding features takes quite some time and there are many requests for additions. Because of this I use Google Moderator to manage requests. Feel free to add/vote for your feature there.','','2014-10-09 17:03:37','admin','comercial',0,'',1,9,0),(50,0,'Maquetacin, Diseo','Que diantres es Quijotipsum?','<p><img alt=\"\" src=\"https://comunidad.local.com/images/mailing/images/1412935026_postal5_quijote.jpeg\" style=\"float:left; height:150px; margin:15px; width:200px\" />En un lugar de la Mancha, de cuyo nombre no quiero acordarme, no ha mucho tiempo que viv&iacute;a un hidalgo de los de lanza en astillero, adarga antigua, roc&iacute;n flaco y galgo corredor. Una olla de algo m&aacute;s vaca que carnero, salpic&oacute;n las m&aacute;s noches, duelos y quebrantos los s&aacute;bados, lantejas los viernes, alg&uacute;n palomino de a&ntilde;adidura los domingos, consum&iacute;an las tres partes de su hacienda. El resto della conclu&iacute;an sayo de velarte, calzas de velludo para las fiestas, con sus pantuflos de lo mesmo, y los d&iacute;as de entresemana se honraba con su vellor&iacute; de lo m&aacute;s fino.<!--more--><br />\r\n<br />\r\nTen&iacute;a en su casa una ama que pasaba de los cuarenta, y una sobrina que no llegaba a los veinte, y un mozo de campo y plaza, que as&iacute; ensillaba el roc&iacute;n como tomaba la podadera. Frisaba la edad de nuestro hidalgo con los cincuenta a&ntilde;os; era de complexi&oacute;n recia, seco de carnes, enjuto de rostro, gran madrugador y amigo de la caza.<br />\r\n<br />\r\nQuieren decir que ten&iacute;a el sobrenombre de Quijada, o Quesada, que en esto hay alguna diferencia en los autores que deste caso escriben; aunque, por conjeturas veros&iacute;miles, se deja entender que se llamaba Quejana. Pero esto importa poco a nuestro cuento; basta que en la narraci&oacute;n d&eacute;l no se salga un punto de la verdad.<br />\r\n<br />\r\nPara mas informaci&oacute;n <a href=\"http://www.quijotipsum.com/\">http://www.quijotipsum.com/</a></p>\r\n','1412935026_postal5_quijote.jpeg','2014-09-19 11:57:06','admin','comercial',0,'',1,0,1),(51,0,'Maquetacin, Diseo','Lorem ipsum dolor sit amet','<p><img alt=\"\" src=\"https://comunidad.local.com/images/mailing/images/lorem-ipsum.jpg\" style=\"float:left; height:139px; margin:15px; width:200px\" /></p>\r\n\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque nec interdum elit, sit amet porttitor est. Nulla malesuada molestie scelerisque. <strong>Nam convallis auctor sapien</strong>, a dapibus sem ornare et. Aenean eu orci vel tortor tempus sodales a eu elit. Aenean aliquam sodales massa, vel sodales turpis facilisis nec. Morbi euismod commodo rhoncus. Sed rutrum pretium quam semper dignissim. Maecenas vel augue sapien.</p>\r\n\r\n<p><!--more-->Nullam rhoncus ac felis ut aliquam. Integer elementum, leo vitae convallis convallis, nisl tortor gravida sapien, bibendum suscipit ex quam sit amet massa. Proin sed purus fringilla, eleifend libero ut, imperdiet velit. Nullam eleifend aliquam mauris non posuere. Maecenas viverra felis enim. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Integer tristique pellentesque enim at lobortis.</p>\r\n\r\n<p>Curabitur dignissim mi sed venenatis scelerisque. <strong>Quisque</strong> eu risus fringilla, rutrum leo feugiat, tincidunt nibh. Nunc viverra porta erat. In tincidunt, nisi luctus vestibulum interdum, lectus odio imperdiet tellus, rhoncus tempus velit purus non ex. Fusce pretium ligula vitae sodales pulvinar. Nunc a mi pretium, semper nisi quis, hendrerit tellus. Sed tristique lectus non finibus pellentesque.</p>\r\n\r\n<p>Proin at dolor cursus, ullamcorper eros id, ornare tellus. Vivamus bibendum accumsan sem at cursus. Suspendisse molestie lorem molestie, volutpat mauris eget, bibendum quam. Aliquam faucibus rhoncus mauris, eu tempor leo porttitor a. Cras at tempor dui, nec lacinia magna. Nam blandit hendrerit risus, quis lobortis elit mattis ac. Nulla quis eleifend tortor, eget aliquam leo. Phasellus a quam vel turpis pretium eleifend facilisis ac diam. Suspendisse dapibus vitae metus ut scelerisque. Proin sodales sagittis tellus a pretium.</p>\r\n','1412935528_lorem-ipsum.jpg','2014-10-10 12:05:28','admin','comercial',0,'',1,0,1),(66,0,'','foro test alerts','desc trext alerts','','2014-12-24 02:54:02','admin','comercial',0,'',1,13,0),(52,0,'Maquetacin, Diseo','Flat design concept','<p><br />\r\n<img alt=\"\" src=\"https://comunidad.local.com/images/mailing/images/flatinspiration04.jpg\" style=\"float:left; height:225px; margin:15px; width:300px\" />Flat design is a minimalistic design approach that emphasizes usability. It features clean, open space, crisp edges, bright colours and two-dimensional/flat illustrations.</p>\r\n\r\n<p><br />\r\nMicrosoft was one of the first to apply this design style to its interface, seen by some as a backlash against the popular skeuomorphic design that Apple kicked off with its iOS interface. Instead of converting a real-life object, such as a calendar, into a tiny realistic illustration, advocates of flat design identify apps with simple, icon-like images.</p>\r\n\r\n<p><br />\r\nRather than bringing aspects of real life to an interface, this illustrates a clear separation between technology and tactile objects.</p>\r\n\r\n<h2>Minimalist doesn&#39;t mean boring</h2>\r\n\r\n<p>In flat design, ornamental elements are viewed as unnecessary clutter. If an aspect serves no functional purpose, it&#39;s a distraction from user experience. This is the reason for the minimalistic nature of flat design.</p>\r\n\r\n<p><br />\r\nHowever, just because it lacks any flashy design doesn&#39;t mean this style is boring. Bright, contrasting colours make illustrations and buttons pop from backgrounds, easily grab attention, and guide the user&#39;s eye. The purpose of minimalistic imagery also contributes to flat design&#39;s functional character.</p>\r\n','1412947247_flatinspiration04.jpg','2014-10-10 15:20:47','admin','comercial',0,'',1,0,1),(53,0,'Diseo, Fotografa','The value of photography in web design','<div>\r\n	No matter the images you have in your library they will rarely be suitable for the task. Sorry, but that is most often the case. You need photography that has been taken for purpose, by a professional and with a brief from both client and designer.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Consider the responsive nature of web design, different areas of the photo will be visible depending on the device size. The exact same web page is then rendered differently on different devices but we still keep control.</div>\r\n','1412947945_squiders1.jpg','2014-10-10 15:32:25','admin','comercial',0,'',1,0,1),(67,0,'','foro test alerts','desc trext alerts','','2014-12-24 02:54:49','admin','comercial',0,'',1,14,0),(54,0,'Maquetacin, Diseo','10 design mistakes that will bust your budget','<p>Not all projects are smooth sailing. Sometimes things go wrong, clients aren&#39;t happy and the time and resources you originally planned to spend on the project expands exponentially. Your expected profit becomes dramatically scaled down and you may even end up making a loss...</p>\r\n\r\n<p><br />\r\nHead some of the major problems off at the start by recognising these 10 common design project pitfalls and sidestepping them before they come back to bite you on your creative ass...</p>\r\n\r\n<h3>01. You said &#39;yes&#39; but should have said &#39;no&#39;</h3>\r\n\r\n<p><img alt=\"\" src=\"https://comunidad.local.com/images/mailing/images/design-busting-mistakes.jpg\" style=\"width:100%\" /><br />\r\n<br />\r\nWe&acute;ve all done it. The lure of a big job can make you accept a commission without really thinking it through. Especially if you don&acute;t have any other work on. But ask yourself: are you really right for the job? Does it excite you? Sometimes it&acute;s better to say &acute;no&acute; to avoid problems further down the line.</p>\r\n','1412948542_flat-web-design-9.jpg','2014-10-10 15:42:22','admin','comercial',0,'',1,0,1),(55,0,'','Curso de inscripcion','Curso en el que los usuarios se pueden inscribir con un lmite mximo de usuarios inscritos.','','2014-10-13 10:43:16','admin','comercial',0,'',1,11,0),(56,43,'','foro para el curso 2','La descripcin del foro para el curso2','','2014-1