rentes.jpg','2015-01-21 13:43:36','admin','gerente',0,'',1,0,1),(69,0,'','Entrada en canal gerentes','<p>If you&#39;ve ever written to the DOM from JavaScript or jQuery you will know how quickly your code can begin to look messy, especially if you are using several variables. Angular allows for data to be used right in the markup, leading to clean, easy to read and understand code.<!--more-->There are also some great visualization libraries out there, but they come with a lot of default styling right out of the box. By using Angular, the visualizations are completely unopinionated, and will pick up your style right off the bat.</p>\r\n\r\n<p>I&#39;m not saying this is the best way of creating data visualizations, but it certainly appeals to me!</p>\r\n\r\n<p>I&#39;m rotating the SVG as by default it processes values from the top, and we need this to flipped to take values from the bottom.</p>\r\n\r\n<p>Firstly, we need to create an SVG that spans the full area of our graph, and then inside that use our <code>ng-repeat</code> on a <code>line</code> element.</p>\r\n\r\n<p>Each <code>line</code> element requires a start and end point on both the X (x1, x2) and Y (y1, y2) axis.</p>\r\n\r\n<p>The X axis is pretty simple - we follow the same system as before, so that each line is spaced out evenly across the chart, starting at 0 using <code>$index</code>, and ending where the next line starts, using <code>$index + 1</code>.</p>\r\n\r\n<p>For the Y axis this is where the <code>$index</code> variable comes in to its own, as it allows us to select values from previous or next entries in our array.</p>\r\n\r\n<p>The initial Y point of each line gets the value from the previous data entry using <code>data[$index - 1].value</code> before we then apply similar maths as before. For the second Y point we can just call the straight value from the entry.</p>\r\n\r\n<p>This may sound complicated (and I can assure you that working it out was a bit of a head shrinker!) but hopefully this explanation coupled with the code below should help you make sense of it!</p>\r\n','1426254994_post01.jpg','2015-01-21 13:51:49','admin','gerente',0,'',1,0,1),(70,0,'','Foro El nuevo canal','','','2015-01-22 09:56:15','admin','canal_test',0,'',1,0,0),(71,70,'','Primer foro en el canal de test','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec iaculis quam et risus ullamcorper, id scelerisque mauris cursus. Vestibulum in dapibus massa.','','2015-01-22 09:58:18','pedro','canal_test',0,'',1,0,0),(72,63,'','Primer foro en el rea de prueba sin tareas','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque facilisis leo justo, gravida gravida massa sagittis vitae. Aliquam vitae maximus purus.','','2015-02-17 10:06:59','dcancho','comercial',0,'',1,12,0),(73,43,'','Curso HCV','Foro para consultas del curso HCV','','2015-02-28 00:43:56','claudio','gerente',0,'',1,10,0),(74,70,'','Segundo tema en los foros','Es, pues, de saber que este sobredicho hidalgo, los ratos que estaba ocioso, que eran los ms del ao, se daba a leer libros de caballeras, con tanta aficin y gusto, que olvid casi de todo punto el ejercicio de la caza, y aun la administracin de su hacienda.','','2015-03-02 10:48:31','admin','canal_test',0,'',1,0,0);

