insert  into `pages`(`page_name`,`page_content`) values ('declaracion','<h2>Declaraci&oacute;n de derechos y responsabilidades</h2>\r\n	Esta Declaraci&oacute;n de derechos y responsabilidades rige nuestra relaci&oacute;n con los usuarios y con todos aquellos que interact&uacute;an en www.actytukiabi.com. Al utilizar o acceder a www.actytukiabi.com muestras tu conformidad con la presente Declaraci&oacute;n.<br />\r\n	<br />\r\n	1. Privacidad<br />\r\n	Tu privacidad es muy importante para nosotros. Hemos dise&ntilde;ado nuestra Pol&iacute;tica de Privacidad para ayudarte a comprender c&oacute;mo puedes usar comunidadsiempremas.com para compartir informaci&oacute;n con otras personas y c&oacute;mo recopilamos y usamos tu informaci&oacute;n. Te animamos a que leas nuestra Pol&iacute;tica de privacidad y a que la utilices para poder tomar decisiones fundamentadas.<br />\r\n	<br />\r\n	2. Compartir el contenido y la informaci&oacute;n<br />\r\n	Eres el propietario de todo el contenido y la informaci&oacute;n que publicas en www.actitukiabi.com. Adem&aacute;s:<br />\r\n	<br />\r\n	1. Para el contenido protegido por derechos de propiedad intelectual, como fotograf&iacute;as y v&iacute;deos (en adelante, &quot;contenido de PI&quot;), nos concedes espec&iacute;ficamente el siguiente permiso: nos concedes una licencia no exclusiva, transferible, con posibilidad de ser sub-otorgada, sin royalties, aplicable globalmente, para utilizar cualquier contenido de PI que publiques en www.actitukiabi.com<br />\r\n	<br />\r\n	2. Cuando eliminas contenido de PI, &eacute;ste es borrado de forma similar a cuando vac&iacute;as la papelera o papelera de reciclaje de tu equipo inform&aacute;tico. No obstante, entiendes que es posible que el contenido eliminado permanezca en copias de seguridad durante un plazo de tiempo razonable (si bien no estar&aacute; disponible para terceros).<br />\r\n	<br />\r\n	3. Siempre valoramos tus comentarios o sugerencias acerca de www.actitukiabi.com, pero debes entender que podr&iacute;amos utilizarlos sin obligaci&oacute;n de compensarte por ello (del mismo modo que t&uacute; no tienes obligaci&oacute;n de ofrecerlos).<br />\r\n	<br />\r\n	3. Seguridad<br />\r\n	Hacemos todo lo posible para hacer que www.actitukiabi.comsea un sitio seguro, pero no podemos garantizarlo. Necesitamos tu ayuda para lograrlo, lo que implica los siguientes compromisos:<br />\r\n	<br />\r\n	1. No enviar&aacute;s ni publicar&aacute;s de ning&uacute;n otro modo comunicaciones comerciales no autorizadas (como correo no deseado) en www.actitukiabi.com<br />\r\n	<br />\r\n	2. No participar&aacute;s en marketing multinivel ilegal, como el de tipo piramidal, en www.actitukiabi.com.<br />\r\n	<br />\r\n	3. No cargar&aacute;s virus ni c&oacute;digo malintencionado de ning&uacute;n tipo.<br />\r\n	<br />\r\n	4. No solicitar&aacute;s informaci&oacute;n de inicio de sesi&oacute;n ni acceder&aacute;s a una cuenta perteneciente a otro usuario.<br />\r\n	<br />\r\n	5. No molestar&aacute;s, intimidar&aacute;s ni acosar&aacute;s a ning&uacute;n usuario.<br />\r\n	<br />\r\n	6. No publicar&aacute;s contenido que resulte hiriente, intimidatorio o pornogr&aacute;fico, que incite a la violencia o que contenga desnudos o violencia gr&aacute;fica o injustificada.<br />\r\n	<br />\r\n	7. No ofrecer&aacute;s ning&uacute;n concurso, regalo ni apuesta (colectivamente, &quot;promoci&oacute;n&quot;) sin nuestro consentimiento previo por escrito. Si damos nuestro consentimiento, tendr&aacute;s completa responsabilidad de la promoci&oacute;n y seguir&aacute;s nuestras normas de las promociones y cumplir&aacute;s todas las leyes aplicables.<br />\r\n	<br />\r\n	8. No utilizar&aacute;s www.actitukiabi.compara actos il&iacute;citos, enga&ntilde;osos, malintencionados o discriminatorios.<br />\r\n	<br />\r\n	9. No realizar&aacute;s ninguna acci&oacute;n que pudiera inhabilitar, sobrecargar o afectar al funcionamiento correcto de www.actytukiabi.com, como, por ejemplo, un ataque de denegaci&oacute;n de servicio.<br />\r\n	<br />\r\n	10. No facilitar&aacute;s ni fomentar&aacute;s la violaci&oacute;n de esta Declaraci&oacute;n.<br />\r\n	<br />\r\n	11. No compartir&aacute;s la contrase&ntilde;a, no dejar&aacute;s que otra persona acceda a tu cuenta, ni har&aacute;s cualquier cosa que pueda poner en peligro la seguridad de tu cuenta.<br />\r\n	<br />\r\n	12. No transferir&aacute;s la cuenta (incluida cualquier p&aacute;gina o aplicaci&oacute;n que administres) a nadie sin nuestro consentimiento previo por escrito.<br />\r\n	<br />\r\n	13. Si seleccionas un nombre de usuario para tu cuenta, nos reservamos el derecho a eliminarlo o reclamarlo si lo consideramos oportuno.<br />\r\n	<br />\r\n	4. Protecci&oacute;n de los derechos de otras personas<br />\r\n	Respetamos los derechos de otras personas y esperamos que t&uacute; hagas lo mismo.<br />\r\n	<br />\r\n	1. No publicar&aacute;s contenido ni realizar&aacute;s ninguna acci&oacute;n en www.actytukiabi.com que infrinja o viole los derechos de otros o que viole la ley de alg&uacute;n modo.<br />\r\n	<br />\r\n	2. Podemos retirar cualquier contenido o informaci&oacute;n que publiques en www.actytukiabi.com si consideramos que viola esta Declaraci&oacute;n.<br />\r\n	<br />\r\n	3. Si infringes repetidamente los derechos de propiedad intelectual de otra persona, desactivaremos tu cuenta si es oportuno.<br />\r\n	<br />\r\n	4. No utilizar&aacute;s nuestros copyrights o marcas registradas (incluidos Kiabi, los logotipos de Kiabi) ni ninguna marca que se parezca a las nuestras sin nuestro permiso por escrito.<br />\r\n	<br />\r\n	5. No publicar&aacute;s los documentos de identificaci&oacute;n ni informaci&oacute;n financiera de nadie en www.actytukiabi.com<br />\r\n	<br />\r\n	Si seleccionas un nombre de usuario para tu cuenta, nos reservamos el derecho a eliminarlo o reclamarlo si lo consideramos oportuno (por ejemplo, si el propietario de una marca comercial se queja por un nombre de usuario que no est&aacute; relacionado estrechamente con el nombre real del usuario).<br />\r\n	<br />\r\n	5. Definiciones<br />\r\n	1. El t&eacute;rmino &quot;actytu&quot; se refiere a las funciones y servicios que proporcionamos, incluidos los que se ofrecen a trav&eacute;s de (a) nuestro sitio web en www.actytukiabi.com y versiones m&oacute;viles; (b) nuestra Plataforma; (c) plugins sociales, como el bot&oacute;n &quot;Me gusta&quot;,.<br />\r\n	<br />\r\n	2. El t&eacute;rmino &quot;Plataforma&quot; se refiere al conjunto de API y servicios que permiten que otras personas, incluidos los desarrolladores de aplicaciones y los operadores de sitios web, recuperen datos de actytu o nos los proporcionen a nosotros.<br />\r\n	<br />\r\n	3. El t&eacute;rmino &quot;informaci&oacute;n&quot; se refiere a los hechos y otra informaci&oacute;n sobre ti, incluidas las acciones que realizas.<br />\r\n	<br />\r\n	4. El t&eacute;rmino &quot;contenido&quot; se refiere a todo lo que publicas en www.actytukiabi.com que no se incluye en la definici&oacute;n de &quot;informaci&oacute;n&quot;.<br />\r\n	<br />\r\n	5. El t&eacute;rmino &quot;datos&quot; se refiere al contenido y la informaci&oacute;n que pueden recuperar terceros de www.actytukiabi.com o proporcionan a actytu a trav&eacute;s de la plataforma.<br />\r\n	<br />\r\n	6. El t&eacute;rmino &quot;publicar&quot; significa publicar en www.actytukiabi.com.<br />\r\n	<br />\r\n	7. Por &quot;usar&quot; se entiende utilizar, copiar, reproducir o mostrar p&uacute;blicamente, distribuir, modificar, traducir y crear obras derivadas.\r\n'),('manifest','<h2>\r\n	T&eacute;rminos y condiciones</h2>\r\nEsta Declaraci&oacute;n de derechos y responsabilidades rige nuestra relaci&oacute;n con los usuarios y con todos aquellos que interact&uacute;an en www.actytukiabi.com. Al utilizar o acceder a www.actytukiabi.com muestras tu conformidad con la presente Declaraci&oacute;n.<br />\r\n<br />\r\n1. Privacidad<br />\r\nTu privacidad es muy importante para nosotros