o autorizadas (como correo no deseado) en www.actitukiabi.com<br />\r\n<br />\r\n2. No participar&aacute;s en marketing multinivel ilegal, como el de tipo piramidal, en www.actitukiabi.com.<br />\r\n<br />\r\n3. No cargar&aacute;s virus ni c&oacute;digo malintencionado de ning&uacute;n tipo.<br />\r\n<br />\r\n4. No solicitar&aacute;s informaci&oacute;n de inicio de sesi&oacute;n ni acceder&aacute;s a una cuenta perteneciente a otro usuario.<br />\r\n<br />\r\n5. No molestar&aacute;s, intimidar&aacute;s ni acosar&aacute;s a ning&uacute;n usuario.<br />\r\n<br />\r\n6. No publicar&aacute;s contenido que resulte hiriente, intimidatorio o pornogr&aacute;fico, que incite a la violencia o que contenga desnudos o violencia gr&aacute;fica o injustificada.<br />\r\n<br />\r\n7. No ofrecer&aacute;s ning&uacute;n concurso, regalo ni apuesta (colectivamente, &quot;promoci&oacute;n&quot;) sin nuestro consentimiento previo por escrito. Si damos nuestro consentimiento, tendr&aacute;s completa responsabilidad de la promoci&oacute;n y seguir&aacute;s nuestras normas de las promociones y cumplir&aacute;s todas las leyes aplicables.<br />\r\n<br />\r\n8. No utilizar&aacute;s www.actitukiabi.compara actos il&iacute;citos, enga&ntilde;osos, malintencionados o discriminatorios.<br />\r\n<br />\r\n9. No realizar&aacute;s ninguna acci&oacute;n que pudiera inhabilitar, sobrecargar o afectar al funcionamiento correcto de www.actytukiabi.com, como, por ejemplo, un ataque de denegaci&oacute;n de servicio.<br />\r\n<br />\r\n10. No facilitar&aacute;s ni fomentar&aacute;s la violaci&oacute;n de esta Declaraci&oacute;n.<br />\r\n<br />\r\n11. No compartir&aacute;s la contrase&ntilde;a, no dejar&aacute;s que otra persona acceda a tu cuenta, ni har&aacute;s cualquier cosa que pueda poner en peligro la seguridad de tu cuenta.<br />\r\n<br />\r\n12. No transferir&aacute;s la cuenta (incluida cualquier p&aacute;gina o aplicaci&oacute;n que administres) a nadie sin nuestro consentimiento previo por escrito.<br />\r\n<br />\r\n13. Si seleccionas un nombre de usuario para tu cuenta, nos reservamos el derecho a eliminarlo o reclamarlo si lo consideramos oportuno.<br />\r\n<br />\r\n4. Protecci&oacute;n de los derechos de otras personas<br />\r\nRespetamos los derechos de otras personas y esperamos que t&uacute; hagas lo mismo.<br />\r\n<br />\r\n1. No publicar&aacute;s contenido ni realizar&aacute;s ninguna acci&oacute;n en www.actytukiabi.com que infrinja o viole los derechos de otros o que viole la ley de alg&uacute;n modo.<br />\r\n<br />\r\n2. Podemos retirar cualquier contenido o informaci&oacute;n que publiques en www.actytukiabi.com si consideramos que viola esta Declaraci&oacute;n.<br />\r\n<br />\r\n3. Si infringes repetidamente los derechos de propiedad intelectual de otra persona, desactivaremos tu cuenta si es oportuno.<br />\r\n<br />\r\n4. No utilizar&aacute;s nuestros copyrights o marcas registradas (incluidos Kiabi, los logotipos de Kiabi) ni ninguna marca que se parezca a las nuestras sin nuestro permiso por escrito.<br />\r\n<br />\r\n5. No publicar&aacute;s los documentos de identificaci&oacute;n ni informaci&oacute;n financiera de nadie en www.actytukiabi.com<br />\r\n<br />\r\nSi seleccionas un nombre de usuario para tu cuenta, nos reservamos el derecho a eliminarlo o reclamarlo si lo consideramos oportuno (por ejemplo, si el propietario de una marca comercial se queja por un nombre de usuario que no est&aacute; relacionado estrechamente con el nombre real del usuario).<br />\r\n<br />\r\n5. Definiciones<br />\r\n1. El t&eacute;rmino &quot;actytu&quot; se refiere a las funciones y servicios que proporcionamos, incluidos los que se ofrecen a trav&eacute;s de (a) nuestro sitio web en www.actytukiabi.com y versiones m&oacute;viles; (b) nuestra Plataforma; (c) plugins sociales, como el bot&oacute;n &quot;Me gusta&quot;,.<br />\r\n<br />\r\n2. El t&eacute;rmino &quot;Plataforma&quot; se refiere al conjunto de API y servicios que permiten que otras personas, incluidos los desarrolladores de aplicaciones y los operadores de sitios web, recuperen datos de actytu o nos los proporcionen a nosotros.<br />\r\n<br />\r\n3. El t&eacute;rmino &quot;informaci&oacute;n&quot; se refiere a los hechos y otra informaci&oacute;n sobre ti, incluidas las acciones que realizas.<br />\r\n<br />\r\n4. El t&eacute;rmino &quot;contenido&quot; se refiere a todo lo que publicas en www.actytukiabi.com que no se incluye en la definici&oacute;n de &quot;informaci&oacute;n&quot;.<br />\r\n<br />\r\n5. El t&eacute;rmino &quot;datos&quot; se refiere al contenido y la informaci&oacute;n que pueden recuperar terceros de www.actytukiabi.com o proporcionan a actytu a trav&eacute;s de la plataforma.<br />\r\n<br />\r\n6. El t&eacute;rmino &quot;publicar&quot; significa publicar en www.actytukiabi.com.<br />\r\n<br />\r\n7. Por &quot;usar&quot; se entiende utilizar, copiar, reproducir o mostrar p&uacute;blicamente, distribuir, modificar, traducir y crear obras derivadas. '),('policy','<h2>\r\n	Pol&iacute;tica de privacidad</h2>\r\n1. Introducci&oacute;n<br />\r\nPreguntas. Si tienes alguna pregunta o duda sobre nuestra pol&iacute;tica de privacidad, ponte en contacto con nuestro equipo de privacidad enviando un mail a Info@actytukiabi.com<br />\r\n<br />\r\n&Aacute;mbito. La presente pol&iacute;tica de privacidad incluye el portal www.actytukiabi.com al completo.<br />\r\n<br />\r\n2. Informaci&oacute;n que recibimos<br />\r\nInformaci&oacute;n que nos env&iacute;as:<br />\r\n<br />\r\nInformaci&oacute;n sobre ti. Cuando te registras en la comunidad de Kiabi, nos facilitas tu nombre, correo electr&oacute;nico y fecha de nacimiento. Tambi&eacute;n podr&aacute;s a&ntilde;adir una foto.<br />\r\n<br />\r\nLos datos personales recabados en el presente formulario ser&aacute;n objeto de tratamiento en un fichero responsabilidad de Espa&ntilde;a KSCE, S.A. cuya finalidad ser&aacute; la gesti&oacute;n de cursos de formaci&oacute;n y eventos que puedan resultar de su inter&eacute;s y el intercambio de informaci&oacute;n de car&aacute;cter profesional. La entrega de todos los datos requeridos en el presente formulario es obligatoria, puesto que dichos datos son imprescindibles para cumplir con las finalidades indicadas anteriormente.<br />\r\n<br />\r\nUsted podr&aacute; ejercitar sus derechos de acceso, rectificaci&oacute;n, cancelaci&oacute;n y/u oposici&oacute;n, dirigiendo una comunicaci&oacute;n firmada por el titular de los datos a la direcci&oacute;n de correo electr&oacute;nico info@actytukiabi.com, ref. &quot;Actytu&quot;, adjuntando copia legible de su DNI e indicando la petici&oacute;n en que se concreta su solicitud y la direcci&oacute;n a la que Espa&ntilde;a KSCE, S.A pueda remitirle la confirmaci&oacute;n de haber cumplido con su solicitud, o en su caso, los motivos que le impiden llevarla a cabo plenamente.<br />\r\n<br />\r\nContenido. Una de las finalidades principales del uso de la comunidad actytu es compartir contenido referente al cambio de actitud ante el cliente, con los dem&aacute;s comerciales.<br />\r\n<br />\r\nInformaci&oacute;n que recopilamos cuando interact&uacute;as en actytu:<br />\r\n<br />\r\nInformaci&oacute;n sobre la actividad en el sitio web. Realizamos un seguimiento de las acciones que llevas a cabo en actytu como indicar que &quot;te gusta&quot; una publicaci&oacute;n, o cuando compartes videos, fotos o comentarios en cada una de las secciones del portal.<br />\r\n<br />\r\n3. Compartir informaci&oacute;n en actytu<br />\r\nNombre y foto del perfil. Ha sido dise&ntilde;ado para que te resulte sencillo encontrar y modificar los campos de nick, foto o estado. Si no quieres compartir la foto de tu perfil, debes eliminarla (o no a&ntilde;adir ninguna).<br />\r\n<br />\r\n4. C&oacute;mo utilizamos tu informaci&oacute;n<br />\r\nUtilizamos la informaci&oacute;n que recopilamos para tratar de ofrecerte una experiencia segura, eficaz y personalizada. A continuaci&oacute;n, incluimos algunos datos sobre c&oacute;mo lo hacemos:<br />\r\n<br />\r\nPara gestionar el servicio. Utilizamos la informaci&oacute;n que recopilamos para ofrecerte nuestros servicios y funciones, evaluarlos y mejorarlos y prestarte servicio t&eacute;cnico. Empleamos la informaci&oacute;n para impedir actividades que podr&iacute;an ser ilegales y para aplicar nuestra Declaraci&oacute;n de Derechos y Responsabilidades. Estos esfuerzos pueden provocar, en ocasiones, el fin o la suspensi&oacute;n temporal o permanente de algunas funciones para algunos usuarios.<br />\r\n<br />\r\nPara ponernos en contacto contigo. Ocasionalmente, podemos ponernos en contacto contigo para informarte de anuncios relativos a servicios.<br />\r\n<br />\r\n6. C&oacute;mo puedes cambiar eliminar informaci&oacute;n<br />\r\nEdici&oacute;n de tu perfil. Puedes cambiar o eliminar la informaci&oacute;n de tu perfil en cualquier momento yendo a tu perfil y haciendo clic en &quot;Editar mi perfil&quot;. La informaci&oacute;n se actualizar&aacute; de inmediato.<br />\r\n<br />\r\n7. C&oacute;mo protegemos la informaci&oacute;n<br />\r\nHacemos todo lo posible para mantener a salvo tu informaci&oacute;n, pero necesitamos tu ayuda.<br />\r\n<br />\r\nMedidas que tomamos para mantener a salvo su informaci&oacute;n. Mantenemos la informaci&oacute;n de tu cuenta en un servidor protegido con un firewall. Cuando introduces informaci&oacute;n confidencial (por ejemplo, contrase&ntilde;as). Tambi&eacute;n utilizamos medidas sociales y automatizadas para aumentar la seguridad (como el an&aacute;lisis de la actividad de la cuenta), podemos limitar el uso de funciones del sitio web en respuesta a posibles signos de abuso, podemos eliminar contenido inadecuado o enlaces a contenido ilegal, y podemos suspender o desactivar cuentas por si hubiera violaciones de nuestra Declaraci&oacute;n de Derechos y Responsabilidades.<br />\r\n<br />\r\nRiesgos inherentes a compartir informaci&oacute;n. Aunque te permitimos definir opciones de privacidad que limiten el acceso a tu informaci&oacute;n, ten en cuenta que ninguna medida de seguridad es perfecta ni impenetrable. No podemos controlar las acciones de otros usuarios con los que compartas informaci&oacute;n. No podemos garantizar que s&oacute;lo vean tu informaci&oacute;n personas autorizadas. No podemos garantizar que la informaci&oacute;n que compartas en comunidadsiempremas.com no pase a estar disponible p&uacute;blicamente. No somos responsables de que ning&uacute;n tercero burle cualquier configuraci&oacute;n de la privacidad o medidas de seguridad en www.actytukiabi.com. Puedes reducir estos riesgos utilizando h&aacute;bitos de seguridad de sentido com&uacute;n como elegir una contrase&ntilde;a segura, utilizar contrase&ntilde;as diferentes para servicios diferentes y emplear software antivirus actualizado.<br />\r\n<br />\r\nInformar de incumplimientos. Deber&iacute;as informarnos de cualquier incumplimiento de la seguridad escribi&eacute;ndonos a info@actytukiabi.com<br />\r\n<br />\r\n9. Otras condiciones<br />\r\nCambios. Podemos cambiar esta Pol&iacute;tica de privacidad conforme a los procedimientos se&ntilde;alados en la Declaraci&oacute;n de Derechos y Responsabilidades. Salvo indicaci&oacute;n en contrario, nuestra pol&iacute;tica de privacidad en vigor se aplica a toda la informaci&oacute;n que tenemos sobre ti y tu cuenta. Si realizamos cambios en esta Pol&iacute;tica de privacidad, te lo notificaremos public&aacute;ndolo aqu&iacute; y en la p&aacute;gina www.actytukiabi.com. Si los cambios son sustanciales, mostraremos un aviso prominente si las circunstancias lo requieren. '),('nueva','<h2>\r\n	T&iacute;tulo de la nueva p&aacute;gina</h2>\r\nla nueva p&aacute;gina 2 y con un poco m&aacute;s de texto de relleno.<br />\r\n<br />\r\n<ul>\r\n	<li>\r\n		Opci&oacute;n 1 de la lista</li>\r\n	<li>\r\n		La opci&oacute;n 2 de la lista</li>\r\n	<li>\r\n		Una tercera opci&oacute;n para la lista de la p&aacute;gina</li>\r\n</ul>\r\nUn poco m&aacute;s de texto para continuar un nuevo parrafo en la p&aacute;gina.'),('reto','<p style=\"text-align: justify; margin: 0px 0px 14px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans;\">\r\n	Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam tempus ultrices auctor. Nunc a arcu nisl. Sed ullamcorper varius mi facilisis facilisis. Duis porta venenatis erat, eu malesuada lorem ultrices quis. Duis quam mi, vulputate sit amet ultrices eget, aliquam in felis. Nulla ut efficitur urna. Donec posuere, libero sed fermentum volutpat, nisl ante egestas sapien, non commodo metus felis sed libero.</p>\r\n<p style=\"text-align: justify; margin: 0px 0px 14px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans;\">\r\n	Vivamus ac metus eget nisi posuere ullamcorper. Proin laoreet elit vel arcu placerat gravida. Curabitur facilisis dui tortor, finibus tincidunt erat ullamcorper in. Maecenas vehicula enim a mattis vulputate. Nulla vel urna metus. Pellentesque vitae velit ipsum. Aenean nec erat velit. Aliquam sed turpis metus. Nullam a nisl sit amet felis aliquam interdum ut eu magna. Morbi condimentum ut felis aliquam faucibus. Nulla ac mi lectus. Mauris ut hendrerit massa. Donec laoreet sit amet sapien quis luctus. Sed fringilla sem non efficitur facilisis. Suspendisse mollis dui eu urna varius, et semper quam imperdiet. In interdum feugiat nisl, in ullamcorper lectus porta imperdiet.<br />\r\n	<br />\r\n	<a href=\"http://google.com\">http://google.com</a></p>\r\n');

/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `username` varchar(100) NOT NULL DEFAULT '',
  `nick` varchar(100) NOT NULL DEFAULT '',
  `user_password` varchar(200) NOT NULL DEFAULT '' COMMENT 'codificacion sha1',
  `email` varchar(200) NOT NULL DEFAULT '',
  `name` varchar(100) NOT NULL DEFAULT '',
  `surname` varchar(200) NOT NULL DEFAULT '',
  `date_add` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `registered` tinyint(1) NOT NULL DEFAULT '1',
  `confirmed` tinyint(1) NOT NULL DEFAULT '0',
  `disabled` tinyint(1) NOT NULL DEFAULT '0',
  `date_disabled` datetime NOT NULL DEFAULT '1970-01-01 00:00:00',
  `canal` varchar(250) NOT NULL DEFAULT '',
  `empresa` varchar(100) NOT NULL DEFAULT '',
  `perfil` varchar(100) NOT NULL DEFAULT '',
  `foto` varchar(250) NOT NULL DEFAULT '',
  `puntos` int(11) NOT NULL DEFAULT '0',
  `participaciones` int(11) NOT NULL DEFAULT '0',
  `user_comentarios` longtext NOT NULL,
  `user_date` date DEFAULT NULL,
  `telefono` varchar(100) NOT NULL DEFAULT '',
  `last_access` datetime DEFAULT NULL,
  PRIMARY KEY (`username`),
  KEY `email` (`email`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

